import React from "react";
import "./List.css";
import * as restaurantData from "./data/restaurant.json";

class List extends React.Component{
    render(){
        const stars = [restaurantData.features[0].ratings[0].stars[0]];
        console.log(stars);

        return(
            <ul>
                {restaurantData.features.map(restaurant => (
                    <li id="first" key={restaurant.restaurantID} >
                    <div>
                        <img className="imgRestaurant" src="logo_resto.png" alt="Le restaurant"></img>
                    </div>
                    <div>
                        <h2>{restaurant.restaurantName}</h2>
                        <div className="moyenneAvis">{restaurant.ratings.stars}</div>
                        <div className="adresse">{restaurant.address}</div>
                    </div>
                </li>
                ))}
            </ul>
        );
    }
}

export default List;
